import logo from './logo.png';
import gh from './gh.svg';
import './App.css';

function Description({str}) {
  return (
    <div className="desc">
      <span>{str}</span>
    </div>
  );
}

function LogoName() {
  return (
    <div className="logoname">
      <img className="logo" src={logo} alt="RN"></img>
      <h1 className="name">Rujul Nayak</h1>
    </div>
  );
}

function Links() {
  return (
    <div className="links">
      <div className="link">
        <img className="icon" src={gh} alt="GitHub"></img>
      </div>
    </div>
  );
}

function Header() {
  return (
    <div className="header">
      <LogoName></LogoName>
      <Description str="Student studying CompSci, Maths, Further&nbsp;Maths & Physics"></Description>
      <Links></Links>
    </div>
  );
}

function Content() {
  return (
    <div className="content">

    </div>
  );
}

function App() {
  return (
    <div className="app">
      <Header></Header>
      <Content></Content>
    </div>
  );
}

export default App;
